import React from 'react'

export default function DogBar({dogs, clickHandler}) {

  const renderDogs = () => {
    return dogs.map(dog => <span onClick={clickHandler} >{dog.name}</span>)
  }

  return (
    <>
      {renderDogs()}
    </>
  )
}
